  this["JST"]["info/about/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>iRecord App is an application that enables you to get involved in\n      biological recording. You can contribute your sightings with photos,\n      GPS acquired coordinates, descriptions and other information, thus providing\n      scientists with important new biodiversity information that contributes to\n      nature conservation, planning, research and education.\n    </p>\n  </li>\n  <li>\n    <p><strong>Who can use the app?</strong></p>\n    <p>We encourage everyone to get involved with recording species as it is\n      very easy and quick to submit useful records without specialist knowledge.\n      It doesn\'t matter whether you are an amateur enthusiast or a qualified\n      biologist, iRecord App is for anyone who wants to contribute to our database\n      observations of the natural environment.\n    </p>\n  </li>\n  <li>\n    <p><strong>App Development</strong></p>\n    <p>This app was hand crafted with love by the BRC mobile development team. For suggestions and feedback\n      please do not hesitate to <a href=\'mailto:apps%40ceh.ac.uk?subject=iRecord%20App%20Support%26Feedback&body=%0A%0A%0AVersion%3A%20' +__e( obj.version ) +'%0ABrowser%3A ' +__e( window.navigator.appVersion ) +'%0A\'>contact us</a>.\n    </p>\n  </li>\n  <li>\n    <p class="app-version">v' +__e( obj.version ) +' (' +__e( obj.build ) +')</p>\n  </li>\n</ul>';return __p};

  this["JST"]["info/brc_approved/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<img src="images/BRC_approved_logo.png" class="brc-approved-logo"/>\n<ul class="table-view">\n  <li>\n    <p>Wherever you see this logo on a biological recording app you can be assured that the\n      data you submit will be: made available to experts for quality assurance;\n      made available for conservation and research and preserved for long-term use.</p>\n  </li>\n  <li>\n    <p>This logo indicates that your data is:</p>\n\n    <ul>\n      <li><p>Sent to the Biological Record Centre’s data warehouse linked to the iRecord\n        system where it is accessible to you as the recorder, to an expert community\n        of verifiers and other users of iRecord.</p>\n      </li>\n      <li>\n        <p>Quality assured data is passed onto Local Environmental Records Centres,\n          National Recording Schemes and to the NBN Gateway.</p>\n      </li>\n    </ul>\n  </li>\n  <li>\n    <p><strong>About BRC</strong></p>\n    <p>\n      The <a href="http://www.brc.ac.uk" rel="external">Biological Records Centre</a> (BRC), established in 1964, is a national\n      focus in the UK for terrestrial and freshwater species recording.\n      BRC works closely with the voluntary recording community, principally\n      through support of national recording schemes and societies. BRC is\n      supported by the Joint Nature Conservation Committee (JNCC) and the\n      Centre for Ecology & Hydrology (CEH) within the Natural Environment\n      Research Council (NERC). The work of BRC is a major component of the\n      National Biodiversity Network (NBN).</p>\n  </li>\n  <li>\n    <p><strong>Which app should I use?</strong></p>\n\n    <p>You might have noticed that several of\n      <a href="http://www.brc.ac.uk/apps" rel="external">BRC apps</a>\n      feature some of the same species?  We have introduced the BRC Approved\n      logo to signify that data from our apps all go to the same place.\n      Therefore, you are free to choose which app you use to record a given species.\n      All records will be sent to the same place, treated in the same way and will meet\n      the established standards required by the Biological  Record Centre.</p>\n  </li>\n\n</ul>';return __p};

  this["JST"]["info/credits/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>\n      <strong>We are very grateful for all the people that helped to\n        create this app:</strong>\n    </p>\n    <p>\n    <ul class="list-style-type: none;">\n      <li>David Roy (CEH)</li>\n      <li>Karolis Kazlauskis (CEH)</li>\n      <li>John van Breda (Biodiverse IT)</li>\n      <li>Tom Humphrey (BSBI)</li>\n      <li>Martin Harvey (CEH)</li>\n      <li>Colin Harrower (CEH)</li>\n      <li>Tom August (CEH)</li>\n      <li>Chris Raper (NHM)</li>\n      <li>Charles Roper (FSC)</li>\n      <li>Matt Smith</li>\n      <li>Alan Rowland</li>\n      <li>David Genney</li>\n    </ul>\n    </p>\n    <p>\n      This app was part-funded by the Centre for Ecology & Hydrology/Joint Nature Conservation Committee partnership supporting BRC.\n    </p>\n  </li>\n</ul>\n\n\nIcons:\nHabitat - Yu luck from the Noun Project';return __p};

  this["JST"]["info/home/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<div class="app-logo"></div>\n\n<ul class="table-view buttons">\n  <li class="table-view-cell">\n    <a href="#info/management" class="navigate-right">\n      <span class="media-object pull-left icon icon-info"></span>\n      Management\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#species" class="navigate-right">\n      <span class="media-object pull-left icon icon-eye"></span>\n      Identify and Record\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info" class="navigate-right">\n      <span class="media-object pull-left icon icon-info"></span>\n      App Info\n    </a>\n  </li>\n</ul>\n\n';return __p};

  this["JST"]["info/location/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>Check with the interactive map (below) to see if your farm is in a rare\n      arable plant ‘hotspot’ – if you have rare plants on your farm\n      there could well be more!</p>\n  </li>\n  <li>\n    <p>Rare arable plants tend to occur on parts of the farm that have received\n      lower inputs of herbicide and fertiliser, for example, field edges,\n      awkward corners, land adjacent to old tracks etc.</p>\n  </li>\n  <li>\n    <p>Rare arable plants can be found on a range of soil types but\n      they thrive where fertility is lower and where there is less pressure\n      from competitive weeds.</p>\n  </li>\n  <li>\n    <p>Grassland and old grass margins that were once arable may\n      still have a seed bank of rare plants.</p>\n  </li>\n  <li>\n    <h3 style="white-space:normal">Arable plant richness based on 120 rare\n      and/or declining species</h3>\n    <div id="heat-map"></div>\n  </li>\n</ul>\n\n';return __p};

  this["JST"]["info/management/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>The same basic principles of good agricultural management are also\n      applicable to the successful conservation of rare arable flowers in\n      modern farming systems:\n    </p>\n    <ul>\n      <li><p>Seed bed comprising a firm, fine tilth in spring or autumn</p></li>\n      <li><p>Variation of management periodically to benefit the greatest\n          number of species</p></li>\n      <li><p>Management of undesirable species where necessary</p></li>\n    </ul>\n  </li>\n  <li>\n    <p><strong>Seed beds</strong> – good quality seed beds are important for\n      establishing rare arable plants. They have small seeds and therefore\n      require a weed-free seed bed with a firm, fine tilth to maximise their\n      chances of survival. As for a crop, rolling the seed bed is important to\n      ensure adequate contact with moisture and improved germination.</p>\n  </li>\n  <li>\n    <p><strong>Cultivation</strong> – many rare arable plants have long-lived\n      seed banks buried in the soil. Inversion tillage (ploughing) is a good\n      way of bringing this seed to the surface and rejuvenating the population.\n      Once the plants have set seed, ploughing then helps to replenish the seed\n      bank through the soil profile and bury problem weeds. However, some\n      species have short-lived seeds, such as \n      <a href="#species/109">spreading hedge-parsley</a>,\n       and prefer reduced tillage. From a practical conservation\n      perspective it is therefore best to vary the depth and timing of tillage\n      to provide benefits to the maximum number of species. However, it is\n      always good to include ploughing into the\n      cultivation plan, at least every third or fourth year.</p>\n  </li>\n  <li>\n    <p><strong>Season</strong> – like crops, rare arable plants establish\n      best in autumn or spring (see individual species accounts). They are\n      annuals so must be given the opportunity to complete their lifecycle\n      in one growing season. It is especially important they are allowed to\n      flower and set seed from mid-summer to September. Unless you need to\n      manage for a specific rare species, it is good practice to vary the\n      season of cultivation (spring, autumn) to benefit the most species.</p>\n  </li>\n  <li>\n    <p><strong>Weed management</strong> – some areas managed for rare arable\n      plants can become weedy with undesirable species like sterile brome and\n      thistles. If cover of such species is particularly dense they will need\n      to be managed. There are several practical options to achieve this:\n    </p>\n    <ul>\n      <li>\n        <p><b>Inversion</b> – ploughing is a good way of burying problem species\n          (and uncovering seed banks of rare plants). Alternation of ploughing\n          and reduced tillage is good practice.\n        </p>\n      </li>\n      <li>\n        <p><b>Herbicides</b>* – application of herbicides can wipe out rare\n          arable plants so only apply where necessary and seek advice from a\n          qualified agronomist and your Scheme Advisor. Appropriate product\n          selection will vary according to the rare species and the problem\n          weeds. Spot application and weed wiping can be helpful in controlling\n          some weed infestations. Application of broad-spectrum herbicide after\n          the rare species have set seed is a good means of controlling perennial\n          weeds like creeping thistle.\n        </p>\n        <small>* Always follow the instructions on the product label when applying herbicide.</small>\n      </li>\n      <li>\n        <p><b>Topping</b> – topping > 30cm is a useful technique to prevent\n          seeding of undesirable species such as wild oats and creeping thistle\n          during the growing season where there is a good height difference\n          between the rare species and the problem weeds.\n        </p>\n      </li>\n    </ul>\n  </li>\n  <li>\n    <p><strong>Locations</strong> – Areas managed for arable plants offer\n      conservation benefits in both fixed or rotated locations.\n    </p>\n    <ul>\n      <li>\n        <p><b>Rotation</b> – this can help reduce the build-up of undesirable weeds on arable\n          plant areas and also spreads the benefit of uncropped cultivated\n          areas around the whole farm, and fits in with farming operations\n          such as inversion tillage, and crop rotations.\n        </p>\n      </li>\n      <li>\n        <p><b>Fixed locations</b> – for known populations of rare species it can\n          be beneficial to fix the location of cultivated areas to ensure\n          continued survival of scarce species. In addition, over time, fixed\n          areas should create lower fertility conditions favoured by these species.\n        </p>\n      </li>\n    </ul>\n  </li>\n</ul>\n';return __p};

  this["JST"]["info/menu_help/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<div class="app-logo-dark"></div>\n\n<ul class="table-view buttons">\n  <li class="table-view-cell">\n    <a href="#info/about" class="navigate-right">\n      <span class="media-object pull-left icon icon-info"></span>\n      About\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/privacy" class="navigate-right">\n      <span class="media-object pull-left icon icon-lock-closed"></span>\n      Privacy Policy\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/brc-approved" class="navigate-right">\n      <span class="media-object pull-left icon icon-thumbs-up"></span>\n      BRC Approved\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/credits" class="navigate-right">\n      <span class="media-object pull-left icon icon-heart"></span>\n      Credits\n    </a>\n  </li>\n</ul>';return __p};

  this["JST"]["info/menu_management/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view buttons"><li class="table-view-cell">\n  <li class="table-view-cell">\n    <a href="#info/management/why" class="navigate-right">\n      <span class="media-object pull-left icon icon-question"></span>\n      Why conserve arable flowers\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/management/location" class="navigate-right">\n      <span class="media-object pull-left icon icon-map"></span>\n      Pick the right location\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/management/management" class="navigate-right">\n      <span class="media-object pull-left icon icon-grid"></span>\n      Managing for arable flowers\n    </a>\n  </li>\n  <li class="table-view-cell">\n    <a href="#info/management/schemes" class="navigate-right">\n      <span class="media-object pull-left icon icon-pound"></span>\n      Schemes and advice\n    </a>\n  </li>\n</ul>';return __p};

  this["JST"]["info/privacy/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p><strong>Use of your name</strong></p>\n\n    <p>If you choose to create a user account for the app, this will be created on the\n      <a href="http://irecord.org.uk" rel="external">Biological Record Centre\'s iRecord system</a>.\n      This enables you to log in and see your records and those submitted by other people for all\n      species. Your name, as specified when you create the account, will appear next to your\n      records and will be viewable by other users of iRecord.</p>\n  </li>\n  <li>\n    <p><strong>E-mail address</strong></p>\n\n    <p>To create an account you will need to supply your e-mail address, which will be used in order\n      to validate your account and to send you periodic updates and important information about the\n      project. Your email address will not be shown and disseminated with your records but will be\n      available to the verifying experts if they need to contact you about your sightings. You are\n      able to delete your iRecord account or opt out of receiving emails at any time.</p>\n  </li>\n  <li>\n    <p><strong>Other information collected by the application</strong></p>\n\n    <p>All records submitted will be stored permanently on a secure server at the Biological Record\n      Centre. Records will be made accessible to Local Environmental Record Centres, conservation\n      organisations, scientific researchers, the NBN Gateway and the public.</p>\n  </li>\n  <li>\n    <p><strong>How long will my data be stored?</strong></p>\n\n    <p>Your submitted records will be stored permanently and used to inform the conservation and study\n      of the recorded species in the future.</p>\n  </li>\n  <li>\n    <p><strong>Who will have access to my personal data?</strong></p>\n\n    <p>Only those directly involved in developing this app and running this recording scheme\n      or verifying records as experts, will have access to your email address.\n      Unless required by law, data will not be made available to any third parties unless we have\n      obtained your permission to do so.</p>\n  </li>\n  <li>\n    <p><strong>Use of images submitted with the app</strong></p>\n\n    <p>By submitting a photograph with this app you:</p>\n    <ul>\n      <li>\n        <p>Give the project and its partners permission to publish the file/s on their respective websites\n          and to use the file/s in any publicity materials they produce.</p>\n      </li>\n      <li>\n        <p>Grant the project and its partners a non-exclusive, worldwide licence to republish the file/s\n          in any format including, without limitation, in print and electronic formats.</p>\n      </li>\n      <li>\n        <p>Warrant that the file is entirely your own work and has not been copied in whole, or in part,\n          from any 3rd party and does not infringe any 3rd party intellectual property rights.</p>\n      </li>\n      <li>\n        <p>Waive all moral rights in, and arising from your photograph(s), but retain\n          ownership of the copyright in your file(s) as its author.</p>\n      </li>\n    </ul>\n  </li>\n  <li>\n    <p>Wherever possible you will receive credit for the reproduction of your work on, or next to, your\n      photograph or file, although we reserve the right to exclude a direct attribution where this\n      affects the aesthetic of the reproduction.</p>\n  </li>\n</ul>';return __p};

  this["JST"]["info/schemes/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>There are many opportunities to manage for arable plants that are\n      supported by payments or advice. These include the Basic Payment Scheme,\n      agri-nvironment schemes and the Campaign for the Farmed Environment.\n      Each of these have their own rules and eligibility criteria so please\n      ensure you are fully compliant with them.\n    </p>\n    <ol>\n      <li>\n        <p>Basic Payment Scheme habitats eligible as Ecological Focus Areas (EFA)\n          such as catch and cover crops, and fallow land can be managed\n          sympathetically for rare arable plants.</p>\n      </li>\n      <li>\n        <p>There are a range of specific management measures which can be used\n          to effectively conserve arable plants. Key management activities are\n          summarized below and may be available as agri-environment scheme options.</p>\n      </li>\n    </ol>\n  </li>\n</ul>\n\n\n<ul class="table-view accordion">\n  <li class="table-view-cell">\n    <a class="collapsed" data-toggle="collapse"\n       href="#Uncropped" aria-controls="Uncropped">\n      Uncropped cultivated areas\n    </a>\n    <div id="Uncropped" class="collapse" >\n      <img src="images/option_27.png">\n      <p>Research suggests the most effective means of conserving rare arable\n        plants is to remove field edges or corners from crop production either\n        on a rotational or permanent basis and cultivate each year to ensure\n        regeneration of rare arable plants. This habitat is especially suited\n        to smaller cornfield flowers, such as\n        <a href="#species/3">ground-pine</a>,\n        <a href="#species/1">pheasant’s-eye</a>,\n        <a href="#species/103">small-flowered catchfly</a> and\n        <a href="#species/101">annual knawel</a>, that cannot\n        compete with modern crops. The diversity of flowers produced by this\n        management provide vitally important pollen and nectar resources for\n        bees and other insects. Do not apply fertilisers and only use herbicides\n        <a href="#mgmtconservation">where absolutely necessary</a>. It is often best to rotate\n        the location of these patches to avoid the build-up of undesirable weeds.\n        Below is a summary of some of the options under agri-environment schemes\n        to provide this habitat:</p>\n      <ul class="table-view accordion">\n        <li class="table-view-cell">\n          <a class="collapsed" data-toggle="collapse"\n             href="#Uncropped-England" aria-expanded="false" aria-controls="Uncropped-England">\n            <span class="icon icon-collapse pull-left"></span>\n            England\n          </a>\n          <div id="Uncropped-England" class="collapse"\n               aria-labelledby="headingOne" aria-expanded="false">\n            <strong>Entry Level Stewardship</strong>\n            <p><b>EF11</b> - Uncropped, cultivated margins for rare plants</p>\n            <strong>Higher Level Stewardship</strong>\n            <p>\n              <b>HF11</b> - Uncropped, cultivated margins for rare plants </br>\n              <b>HF20</b> - Cultivated fallow plots or margins for arable plants\n            </p>\n            <strong>Countryside Stewardship</strong>\n            <p><b>AB11</b> - Cultivated areas for arable plants</p>\n          </div>\n        </li>\n      </ul>\n    </div>\n  </li>\n</ul>\n\n<ul class="table-view accordion" id="accordion">\n  <li class="table-view-cell">\n    <a class="collapsed" data-toggle="collapse" data-parent="#accordion"\n       href="#England" aria-expanded="false" aria-controls="England">\n      <span class="icon icon-collapse pull-left"></span>\n      England\n    </a>\n    <p id="England" class="collapse"\n       aria-labelledby="headingOne" aria-expanded="false">\n      <a href="https://www.gov.uk/government/collections/countryside-stewardship-get-paid-for-environmental-land-management">Countryside Stewardship</a></br>\n      <a href="https://www.gov.uk/guidance/environmental-stewardship">Environmental Stewardship</a> (closed to new applicants)\n    </p>\n  </li>\n  <li class="table-view-cell">\n    <a class="collapsed" data-toggle="collapse" data-parent="#accordion"\n       href="#Wales" aria-expanded="false" aria-controls="Wales">\n      <span class="icon icon-collapse pull-left"></span>\n      Wales\n    </a>\n    <p id="Wales" class="collapse"\n       aria-labelledby="headingOne" aria-expanded="false">\n      <a href="http://gov.wales/topics/environmentcountryside/farmingandcountryside/farming/schemes/glastir/?lang=en">Glastir</a>\n    </p>\n  </li>\n  <li class="table-view-cell">\n    <a class="collapsed" data-toggle="collapse" data-parent="#accordion"\n       href="#Scotland" aria-expanded="false" aria-controls="Scotland">\n      <span class="icon icon-collapse pull-left"></span>\n      Wales\n    </a>\n    <p id="Scotland" class="collapse"\n       aria-labelledby="headingOne" aria-expanded="false">\n      <a href="https://www.ruralpayments.org/publicsite/futures/topics/all-schemes/agri-environment-climate-scheme/">Agri-environment Climatic Scheme</a></br>\n      <a href="http://www.gov.scot/Topics/farmingrural/Agriculture/Environment/Agrienvironment/RuralSteward/RSSintro">Rural Stewardship Scheme</a> (closed to new applicants)\n    </p>\n  </li>\n  <li class="table-view-cell">\n    <a class="collapsed" data-toggle="collapse" data-parent="#accordion"\n       href="#Ireland" aria-expanded="false" aria-controls="Ireland">\n      <span class="icon icon-collapse pull-left"></span>\n      Northern Ireland\n    </a>\n    <p id="Ireland" class="collapse"\n       aria-labelledby="headingOne" aria-expanded="false">\n      <a href="https://www.gov.uk/government/news/new-environmental-scheme-for-farmers-to-prioritise-biodiversity">Environmental Farming Scheme </a></br>\n      <a href="https://www.dardni.gov.uk/articles/northern-ireland-countryside-management-scheme-nicms">Countryside Management Scheme</a> (closed to new applicants)\n    </p>\n  </li>\n</ul>\n';return __p};

  this["JST"]["info/terms/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += ' <div class="info-message">\n        <p>By using iRecord, you agree to these Terms and Conditions of Use. If you do not agree, please do not use the site.</p>\n    </div>\n\n    <ol>\n        <li>\n            <p>When you use iRecord, you create and upload content - for instance, wildlife observations, photos of\n            nature, your descriptions of it, and messages to the forums. By putting this information on the\n            site, you are saying that:</p>\n            <ol type="a" style="text-indent: 0">\n                <li><p>the content is yours, or you have the permission of the owner to agree to this usage, and</p></li>\n                <li><p>you agree that the content can be used on this site, and</p></li>\n                <li><p>you agree that your wildlife observations can be made publicly available for wider use</p></li>\n            </ol>\n        </li>\n        <li>\n            <p> Wildlife observations collected through this site will be stored securely at the Biological Records\n            Centre and made available to experts for verification.</p>\n        </li>\n        <li>\n            <p>Verified observations will be made publicly available via the NBN Gateway in a dataset administered\n            by the Biological Records Centre and/or the relevant national recording scheme. If you do not want\n            your observations to be made available in this way, please do not submit them.</p>\n        </li>\n        <li>\n            <p>Once verified records have been made publicly available, their use will be governed by the NBN\n            Gateway Terms and Conditions, e.g. use of the data for commercial purposes will not be allowed\n            without written permission from the organisation administering the dataset.</p>\n        </li>\n        <li>\n            <p>Please do not submit records to this site that have already been submitted to a Vice County\n            Recorder, Local Records Centre, National Recording Scheme or another online wildlife recording\n            system.</p>\n        </li>\n        <li>\n            <p>Having submitted a record to this site, please do not submit it to other organisations or online\n            recording schemes. It will be made available to local records centres, conservation organisations,\n            natural history societies and others with a legitimate interest in the data via the NBN Gateway.</p>\n        </li>\n        <li>\n            <p>You may view wildlife records submitted to this website by other users, but you may not store them,\n            republish them, exploit them for commercial or academic research purposes, or pass them on to any\n            third party.</p>\n        </li>\n        <li>\n            <p>Your contact details will be held in a database at the Biological Records Centre and will only be\n            used to contact you if there is a query about the verification of your wildlife observations.</p>\n        </li>\n        <li>\n            <p>Your contact details will not be passed on to any third parties without your permission.</p>\n        </li>\n        <li>\n            <p>Your name will be stored as part of the record and may be made publicly available via the NBN\n            Gateway along with the species name, date and location of the record.</p>\n        </li>\n        <li>\n            <p>If you submit a record of a species that could be vulnerable to disturbance or persecution if the\n            record is made publicly available, the record will be flagged as ‘sensitive’ and will not be made\n            publicly available.</p>\n        </li>\n        <li>\n            <p>iRecord uses cookies to enhance site functionality, for example to remember the positions of maps\n            and which data input values need to be remembered between usages of a screen. It also uses cookies\n            for tracking but not for advertising or any other use. If you do not consent to these cookies being\n            stored on your hard disk either disable cookies or do not sign up to use iRecord.</p>\n        </li>\n    </ol>\n';return __p};

  this["JST"]["info/why/main"] = function(obj) {var __t, __p = '', __e = _.escape;__p += '<ul class="table-view">\n  <li>\n    <p>Many arable flowers have disappeared from the countryside and\n      are amongst the rarest plants in Britain.</p>\n  </li>\n  <li>\n    <p>Their history is entwined with that of farming so they have a\n      special place in our culture. </p>\n  </li>\n  <li>\n    <p>A diversity of flowers at the edge of fields provide nectar and\n      pollen vital for bees, and food for other beneficial insects and birds.</p>\n  </li>\n  <li>\n    <p>They form the base of the food chain for a healthy farmland ecosystem.</p>\n  </li>\n  <li>\n    <p>Conservation of arable flowers is compatible with modern, commercial\n      agriculture.</p>\n  </li>\n</ul>';return __p};

